package main

import "fmt"

func smallestDistancePair(nums []int, k int) int {
	arr := make([]int, 0, k)
	heap := func() {
		for i := len(arr) / 2; i >= 0; i-- {
			heapify(arr, i)
		}
	}
	// 构建一个大小为k的大顶堆
	add := func(v int) {
		if len(arr) < k {
			arr = append(arr, v)
			if len(arr) == k {
				heap()
			}
			return
		}
		if arr[0] > v {
			arr[0] = v
			heapify(arr, 0)
		}
	}
	absLess := func(a, b int) int {
		if a > b {
			return a - b
		}
		return b - a
	}
	for i := 0; i < len(nums); i++ {
		for j := i + 1; j < len(nums); j++ {
			add(absLess(nums[i], nums[j]))
		}
	}
	return arr[0]
}

func heapify(arr []int, i int) {
	n := i
	if i*2+1 < len(arr) && arr[i*2+1] > arr[i] {
		n = i*2 + 1
	}
	if i*2+2 < len(arr) && arr[i*2+2] > arr[n] {
		n = i*2 + 2
	}
	if n == i {
		return
	}
	arr[n], arr[i] = arr[i], arr[n]
	heapify(arr, n)
}

